import React from "react";
import Header from "./components/header/Header";
import "./App.css";
import AddQuestion from "./components/addquestion/AddQuestion";

function App() {
  return (
    <div>
      <Header />
      <Switch>
        <Route path="/question" component={AddQuestion} />
      </Switch>
    </div>
  );
}

export default App;
